Исполнительная документация для проведения работ:
- Обмерный план;
- Планировочное решение (3 варианта);
- Планировочное решение с мебелью;
- План демонтажа перегородок;
- План возводимых перегородок;
- План расстановки оборудования;
- План освещения с привязками;
- План розеточной сети с привязками;
- План полов.

Это новая функция для тех, кто не понимает как будет выглядеть их квартира на плане в виде 2d изображения (чертежа)
3D планировка квартиры - это удобно и понятно расположенная мебель в вашей квартире. 
В состав 3D планировочного дизайн проекта входит:
- обмерный план;
- планировочные решения (2-4 варианта);
- план демонтажа стен;
- план монтажа стен;
- план после перепланировки;
- план расстановки мебели;
- 3D планировка квартиры с расстановкой мебели.
